scriptlet.script:
var emisor=scriptletContext.get("emisor");
var adquiren=scriptletContext.get("adquiren");
var nips=scriptletContext.get("nips");
var rech=scriptletContext.get("rech");
var cons=scriptletContext.get("cons");
var retiros=scriptletContext.get("retiros");
var salida="";

if(emisor == "B003"){
	total=retiros+cons+nips+rech;
	salida+=adquiren+","+retiros+","+cons+","+nips+",0,"+rech+","+total;
}else{
	salida+=adquiren+",0,0,0,0,0,0";
}

scriptletResult=salida;
scriptletContext.putGlobal("salida",salida);
